    if (selection.y > startOffset && selection.x < startOffset + replacedLength) {
        setSelection(startOffset + newLength, 0, true, false);
    } else {
        setSelection(selection.x + newLength - replacedLength, selection.y - selection.x, true, false);
    }
    setCaretLocation();
}

