byte[] transformMappedObject(byte[] bytecode){
    final ClassWriter cw = new ClassWriter(0);
    ClassVisitor cv = new ClassAdapter(cw) {
        private final String[] DEFINALIZE_LIST = { VIEWADDRESS_METHOD_NAME, NEXT_METHOD_NAME, ALIGN_METHOD_NAME, SIZEOF_METHOD_NAME, CAPACITY_METHOD_NAME };
        public MethodVisitor visitMethod(int access, final String name, final String desc, final String signature, final String[] exceptions) {
            for (String method : DEFINALIZE_LIST) {
                if (name.equals(method)) {
                    access &= ~ACC_FINAL;
                    break;
                }
            }
            return super.visitMethod(access, name, desc, signature, exceptions);
        }
    };
    new ClassReader(bytecode).accept(cv, 0);
    return cw.toByteArray();
}

