float[] getGlyphPositions(OutputDevice outputDevice,FSFont font,String text,float[] getGlyphPositions,OutputDevice outputDevice,FSFont font,FSGlyphVector fsGlyphVector){
    Object aaHint = null;
    Object fracHint = null;
    Graphics2D graphics = ((Java2DOutputDevice) outputDevice).getGraphics();
    Font awtFont = ((AWTFSFont) font).getAWTFonts().get(0);
    if (awtFont.getSize() > threshold) {
        aaHint = graphics.getRenderingHint(RenderingHints.KEY_TEXT_ANTIALIASING);
        graphics.setRenderingHint(RenderingHints.KEY_TEXT_ANTIALIASING, antiAliasRenderingHint);
    }
    fracHint = graphics.getRenderingHint(RenderingHints.KEY_FRACTIONALMETRICS);
    graphics.setRenderingHint(RenderingHints.KEY_FRACTIONALMETRICS, fractionalFontMetricsHint);
    GlyphVector vector = ((AWTFSGlyphVector) fsGlyphVector).getGlyphVector();
    float[] result = vector.getGlyphPositions(0, vector.getNumGlyphs() + 1, null);
    if (awtFont.getSize() > threshold) {
        graphics.setRenderingHint(RenderingHints.KEY_TEXT_ANTIALIASING, aaHint);
    }
    graphics.setRenderingHint(RenderingHints.KEY_FRACTIONALMETRICS, fracHint);
    return result;
}

Font createFont(SharedContext ctx,Font rootFont,float size,IdentValue weight,IdentValue style,IdentValue variant){
    int fontConst = Font.PLAIN;
    if (weight != null && (weight == IdentValue.BOLD || weight == IdentValue.FONT_WEIGHT_700 || weight == IdentValue.FONT_WEIGHT_800 || weight == IdentValue.FONT_WEIGHT_900)) {
        fontConst = fontConst | Font.BOLD;
    }
    if (style != null && (style == IdentValue.ITALIC || style == IdentValue.OBLIQUE)) {
        fontConst = fontConst | Font.ITALIC;
    }
    size *= ctx.getTextRenderer().getFontScale();
    Font fnt = rootFont.deriveFont(fontConst, size);
    if (variant != null) {
        if (variant == IdentValue.SMALL_CAPS) {
            fnt = fnt.deriveFont((float) (((float) fnt.getSize()) * 0.6));
        }
    }
    return fnt;
}

