boolean matches(String query,boolean matches,String type,String operator,float value){
    for (Beatmap beatmap : beatmaps) {
        float v;
        switch(type) {
            case "ar":
                v = beatmap.approachRate;
                break;
            case "cs":
                v = beatmap.circleSize;
                break;
            case "od":
                v = beatmap.overallDifficulty;
                break;
            case "hp":
                v = beatmap.HPDrainRate;
                break;
            case "bpm":
                v = beatmap.bpmMax;
                break;
            case "length":
                v = beatmap.endTime / 1000;
                break;
            case "star":
            case "stars":
                v = Math.round(beatmap.starRating * 100) / 100f;
                break;
            default:
                return false;
        }
        boolean met;
        switch(operator) {
            case "=":
            case "==":
                met = (v == value);
                break;
            case ">":
                met = (v > value);
                break;
            case ">=":
                met = (v >= value);
                break;
            case "<":
                met = (v < value);
                break;
            case "<=":
                met = (v <= value);
                break;
            default:
                return false;
        }
        if (met)
            return true;
    }
    return false;
}

