void expectHeader(int length,PacketHandler handler){
    debug(TAG, "expectHeader, length:" + length + ",handler:" + handler);
    if (length == 0) {
        handler.onPacket(null);
        return;
    }
    this.expectBuffer = (ByteBuffer) Util.chunkSlice(this.headerBuffer, this.expectOffset, this.expectOffset + length);
    this.expectHandler = handler;
    int toRead = length;
    while (toRead > 0 && this.overflow.size() > 0) {
        ByteBuffer fromOverflow = this.overflow.remove(this.overflow.size() - 1);
        if (toRead < fromOverflow.capacity())
            this.overflow.add((ByteBuffer) Util.chunkSlice(fromOverflow, toRead, fromOverflow.capacity()));
        int read = Math.min(fromOverflow.capacity(), toRead);
        BufferUtil.fastCopy(read, (ByteBuffer) fromOverflow, this.expectBuffer, this.expectOffset);
        this.expectOffset += read;
        toRead -= read;
    }
    debug(TAG, "expectHeader, expectBuffer:" + expectBuffer + ",expectOffset:" + expectOffset);
}

