    float m00 = left.m00 * right.m00 + left.m10 * right.m01 + left.m20 * right.m02;
    float m01 = left.m01 * right.m00 + left.m11 * right.m01 + left.m21 * right.m02;
    float m02 = left.m02 * right.m00 + left.m12 * right.m01 + left.m22 * right.m02;
