void expectData(int length,PacketHandler handler){
    debug(TAG, "expectData, length:" + length + ",handler:" + handler);
    if (length == 0) {
        handler.onPacket(null);
        return;
    }
    this.expectBuffer = this.allocateFromPool(length, this.state.fragmentedOperation);
    this.expectHandler = handler;
    int toRead = length;
    while (toRead > 0 && this.overflow.size() > 0) {
        ByteBuffer fromOverflow = this.overflow.remove(this.overflow.size() - 1);
        if (toRead < fromOverflow.capacity())
            this.overflow.add((ByteBuffer) Util.chunkSlice(fromOverflow, toRead, fromOverflow.capacity()));
        int read = Math.min(fromOverflow.capacity(), toRead);
        BufferUtil.fastCopy(read, fromOverflow, this.expectBuffer, this.expectOffset);
        this.expectOffset += read;
        toRead -= read;
    }
    debug(TAG, "expectData, expectBuffer:" + expectBuffer + ",expectOffset:" + expectOffset);
}

List<DateGroup> parse(String value,List<DateGroup> parse,String value,Date referenceDate){
