        input = new ANTLRNoCaseInputStream(new ByteArrayInputStream(value.getBytes()));
    } catch (IOException e) {
        _logger.error("could not lex input", e);
    }
    DateLexer lexer = new DateLexer(input);
    List<TokenStream> streams = collectTokenStreams(new CommonTokenStream(lexer));
    List<DateGroup> groups = new ArrayList<DateGroup>();
    TokenStream lastStream = null;
    for (TokenStream stream : streams) {
        lastStream = stream;
        List<Token> tokens = ((NattyTokenSource) stream.getTokenSource()).getTokens();
        DateGroup group = singleParse(stream, value, referenceDate);
        while ((group == null || group.getDates().size() == 0) && tokens.size() > 0) {
            if (group == null || group.getDates().size() == 0) {
                List<Token> endRemovedTokens = new ArrayList<Token>(tokens);
                while ((group == null || group.getDates().isEmpty()) && !endRemovedTokens.isEmpty()) {
                    endRemovedTokens = endRemovedTokens.subList(0, endRemovedTokens.size() - 1);
                    TokenStream newStream = new CommonTokenStream(new NattyTokenSource(endRemovedTokens));
                    group = singleParse(newStream, value, referenceDate);
                    lastStream = newStream;
                }
                while ((group == null || group.getDates().isEmpty()) && tokens.size() >= 1) {
                    tokens = tokens.subList(1, tokens.size());
                    Iterator<Token> iter = tokens.iterator();
                    while (iter.hasNext()) {
                        Token token = iter.next();
                        if (!DateParser.FOLLOW_empty_in_parse186.member(token.getType())) {
                            iter.remove();
                        } else {
                            break;
                        }
                    }
                    TokenStream newStream = new CommonTokenStream(new NattyTokenSource(tokens));
                    group = singleParse(newStream, value, referenceDate);
                    lastStream = newStream;
                }
            }
        }
        if (group != null && !group.getDates().isEmpty() && (streams.size() == 1 || !group.isDateInferred() || !isAllNumeric(lastStream))) {
            group.setFullText(value);
            String prefix = group.getPrefix(1);
            String suffix = group.getSuffix(1);
            if ((prefix.isEmpty() || !Character.isLetter(prefix.charAt(0))) && (suffix.isEmpty() || !Character.isLetter(suffix.charAt(0)))) {
                groups.add(group);
            }
        }
    }
    return groups;
}

boolean testSupportGeneric(int objectType,int typeValue){
    switch(objectType) {
        case EFFECT:
        case FILTER:
            break;
        default:
            throw new IllegalArgumentException("Invalid objectType: " + objectType);
    }
    boolean supported = false;
    if (isEfxSupported()) {
        alGetError();
        int genError;
        int testObject = 0;
        try {
            switch(objectType) {
                case EFFECT:
                    testObject = alGenEffects();
                    break;
                case FILTER:
                    testObject = alGenFilters();
                    break;
                default:
                    throw new IllegalArgumentException("Invalid objectType: " + objectType);
            }
            genError = alGetError();
        } catch (final OpenALException debugBuildException) {
            if (debugBuildException.getMessage().contains("AL_OUT_OF_MEMORY")) {
                genError = AL_OUT_OF_MEMORY;
            } else {
                genError = AL_INVALID_OPERATION;
            }
        }
        if (genError == AL_NO_ERROR) {
            alGetError();
            int setError;
            try {
                switch(objectType) {
                    case EFFECT:
                        alEffecti(testObject, AL_EFFECT_TYPE, typeValue);
                        break;
                    case FILTER:
                        alFilteri(testObject, AL_FILTER_TYPE, typeValue);
                        break;
                    default:
                        throw new IllegalArgumentException("Invalid objectType: " + objectType);
                }
                setError = alGetError();
            } catch (final OpenALException debugBuildException) {
                setError = AL_INVALID_VALUE;
            }
            if (setError == AL_NO_ERROR) {
                supported = true;
            }
            try {
                switch(objectType) {
                    case EFFECT:
                        alDeleteEffects(testObject);
                        break;
                    case FILTER:
                        alDeleteFilters(testObject);
                        break;
                    default:
                        throw new IllegalArgumentException("Invalid objectType: " + objectType);
                }
            } catch (final OpenALException debugBuildException) {
            }
        } else if (genError == AL_OUT_OF_MEMORY) {
            throw new OpenALException(genError);
        }
    }
    return supported;
}

boolean deleteToTrash(File file){
