int handleHitResult(int time,int result,float x,float y,Color color,boolean end,HitObject hitObject,HitObjectType hitResultType,int repeat,boolean noIncrementCombo){
    int hitValue = 0;
    switch(result) {
        case HIT_300:
            hitValue = 300;
            break;
        case HIT_100:
            hitValue = 100;
            comboEnd |= 1;
            break;
        case HIT_50:
            hitValue = 50;
            comboEnd |= 2;
            break;
        case HIT_MISS:
            hitValue = 0;
            comboEnd |= 2;
            resetComboStreak();
            break;
        default:
            return HIT_MISS;
    }
    if (hitValue > 0) {
        SoundController.playHitSound(hitObject.getEdgeHitSoundType(repeat), hitObject.getSampleSet(repeat), hitObject.getAdditionSampleSet(repeat));
        changeScore(getScoreForHit(hitValue, hitObject));
        if (!noIncrementCombo)
            incrementComboStreak();
    }
    health.changeHealthForHit(result);
    hitResultCount[result]++;
    fullObjectCount++;
    if (end) {
        if (comboEnd == 0) {
            result = HIT_300G;
            health.changeHealthForHit(HIT_300G);
            hitResultCount[result]++;
        } else if ((comboEnd & 2) == 0) {
            if (result == HIT_100) {
                result = HIT_100K;
                health.changeHealthForHit(HIT_100K);
                hitResultCount[result]++;
            } else if (result == HIT_300) {
                result = HIT_300K;
                health.changeHealthForHit(HIT_300K);
                hitResultCount[result]++;
            }
        } else if (hitValue > 0)
            health.changeHealthForHit(HIT_MU);
        comboEnd = 0;
    }
    return result;
}

