    int result = 0;
    int shift = 0;
    int b;
    do {
        if (shift >= 32) {
            throw new IndexOutOfBoundsException("varint too long");
        }
        b = inputStream.read();
        result |= (b & 0x7F) << shift;
        shift += 7;
    } while ((b & 0x80) != 0);
    return result;
}

