Rectangle intersection(ReadableRectangle r,Rectangle dest){
    int tx1 = this.x;
    int ty1 = this.y;
    int rx1 = r.getX();
    int ry1 = r.getY();
    long tx2 = tx1;
    tx2 += this.width;
    long ty2 = ty1;
    ty2 += this.height;
    long rx2 = rx1;
    rx2 += r.getWidth();
    long ry2 = ry1;
    ry2 += r.getHeight();
    if (tx1 < rx1)
        tx1 = rx1;
    if (ty1 < ry1)
        ty1 = ry1;
    if (tx2 > rx2)
        tx2 = rx2;
    if (ty2 > ry2)
        ty2 = ry2;
    tx2 -= tx1;
    ty2 -= ty1;
    if (tx2 < Integer.MIN_VALUE)
        tx2 = Integer.MIN_VALUE;
    if (ty2 < Integer.MIN_VALUE)
        ty2 = Integer.MIN_VALUE;
    if (dest == null)
        dest = new Rectangle(tx1, ty1, (int) tx2, (int) ty2);
    else
        dest.setBounds(tx1, ty1, (int) tx2, (int) ty2);
    return dest;
}

