List<String> wrap(org.newdawn.slick.Font font,String text,int width,boolean newlines){
    List<String> list = new ArrayList<String>();
    String str = text;
    String line = "";
    int i = 0;
    int lastSpace = -1;
    while (i < str.length()) {
        char c = str.charAt(i);
        if (Character.isWhitespace(c))
            lastSpace = i;
        String append = line + c;
        if (font.getWidth(append) > width || (newlines && c == '\n')) {
            int split = (lastSpace != -1) ? lastSpace : i;
            int splitTrimmed = split;
            if (lastSpace != -1 && split < str.length() - 1)
                splitTrimmed++;
            list.add(str.substring(0, split));
            str = str.substring(splitTrimmed);
            line = "";
            i = 0;
            lastSpace = -1;
        } else {
            line = append;
            i++;
        }
    }
    if (str.length() != 0)
        list.add(str);
    return list;
}

