void update(int delta){
    if (!playing) {
        return;
    }
    if (pitchTime > 0) {
        pitchTime -= delta;
        if (pitchTime < 0) {
            pitchTime = 0;
        }
        float offset = (pitchEnd - pitchStart) * (1 - (pitchTime / (float) pitchDuration));
        setPitch(pitchStart + offset);
    }
    if (fadeTime > 0) {
        fadeTime -= delta;
        if (fadeTime <= 0) {
            fadeTime = 0;
            if (stopAfterFade) {
                stop();
                return;
            }
        }
