void assignField(Object data,Object val,boolean parentObject,ObjectCache objectCache){
    if (logger.isLevelEnabled(Level.TRACE)) {
        logger.trace("assiging from data {}, val {}: {}", (data == null ? "null" : data.getClass()), (val == null ? "null" : val.getClass()), val);
    }
    if (foreignRefField != null && val != null) {
        Object foreignRef = extractJavaFieldValue(data);
        if (foreignRef != null && foreignRef.equals(val)) {
            return;
        }
        Object cachedVal;
        ObjectCache foreignCache = foreignDao.getObjectCache();
        if (foreignCache == null) {
            cachedVal = null;
        } else {
            cachedVal = foreignCache.get(getType(), val);
        }
        if (cachedVal != null) {
            val = cachedVal;
        } else if (!parentObject) {
            val = createForeignObject(val, objectCache);
        }
    }
    if (fieldSetMethod == null) {
        try {
            field.set(data, val);
        } catch (IllegalArgumentException e) {
            if (val == null) {
                throw SqlExceptionUtil.create("Could not assign object '" + val + "' to field " + this, e);
            } else {
                throw SqlExceptionUtil.create("Could not assign object '" + val + "' of type " + val.getClass() + " to field " + this, e);
            }
        } catch (IllegalAccessException e) {
            throw SqlExceptionUtil.create("Could not assign object '" + val + "' of type " + val.getClass() + "' to field " + this, e);
        }
    } else {
        try {
            fieldSetMethod.invoke(data, val);
        } catch (Exception e) {
            throw SqlExceptionUtil.create("Could not call " + fieldSetMethod + " on object with '" + val + "' for " + this, e);
        }
    }
}

