            }
            return null;
        }
    });
    if (soundWorks) {
        sourceCount = 0;
        sources = BufferUtils.createIntBuffer(maxSources);
        while (AL10.alGetError() == AL10.AL_NO_ERROR) {
            IntBuffer temp = BufferUtils.createIntBuffer(1);
