                    sourceCount++;
                    sources.put(temp.get(0));
                    if (sourceCount > maxSources - 1) {
                        break;
                    }
                }
            } catch (OpenALException e) {
                break;
            }
        }
        Log.info("- " + sourceCount + " OpenAL source available");
        if (AL10.alGetError() != AL10.AL_NO_ERROR) {
            sounds = false;
            music = false;
            soundWorks = false;
            Log.error("- AL init failed");
