long decrement(int index){
    int low = index * config().countingBits();
    int high = (index + 1) * config().countingBits();
    boolean decremented = false;
    boolean nonZero = false;
    long count = 0;
    int pos = 0;
    for (int i = (high - 1); i >= low; i--) {
        if (!decremented) {
            if (counts.get(i)) {
                counts.set(i, false);
                decremented = true;
            } else {
                counts.set(i, true);
                nonZero = true;
            }
        } else {
            if (counts.get(i)) {
                nonZero = true;
            }
        }
        if (counts.get(i)) {
            count += Math.pow(2, pos);
        }
        pos++;
    }
    return count;
}

