Status parseResponseStatus(int statusCode,Throwable error){
    String message = null;
    if (error != null) {
        message = error.getMessage();
        if (message == null) {
            message = error.getClass().getSimpleName();
        }
    }
    if (statusCode == 0) {
        return Status.UNKNOWN.withDescription(message);
    } else {
        if (statusCode >= 200 && statusCode < 400) {
            return Status.OK;
        } else {
            switch(statusCode) {
                case 100:
                    return STATUS_100;
                case 101:
                    return STATUS_101;
                case 400:
