void loadNatives(){
    if (!nativeDir.exists())
        nativeDir.mkdir();
    JarFile jarFile = Utils.getJarFile();
    if (jarFile == null)
        return;
    Enumeration<JarEntry> entries = jarFile.entries();
    while (entries.hasMoreElements()) {
        JarEntry e = entries.nextElement();
        if (e == null)
            break;
        File f = new File(nativeDir, e.getName());
        if (isNativeFile(e.getName()) && !e.isDirectory() && e.getName().indexOf('/') == -1 && !f.exists()) {
            InputStream in = jarFile.getInputStream(jarFile.getEntry(e.getName()));
            OutputStream out = new FileOutputStream(f);
            byte[] buffer = new byte[65536];
            int bufferSize;
            while ((bufferSize = in.read(buffer, 0, buffer.length)) != -1) out.write(buffer, 0, bufferSize);
            in.close();
            out.close();
        }
    }
    jarFile.close();
}

