void initialize(){
    if (initialized) {
        return;
    }
    if (connectionSource == null) {
        throw new IllegalStateException("connectionSource was never set on " + getClass().getSimpleName());
    }
    databaseType = connectionSource.getDatabaseType();
    if (databaseType == null) {
        throw new IllegalStateException("connectionSource is getting a null DatabaseType in " + getClass().getSimpleName());
    }
    if (tableConfig == null) {
        tableInfo = new TableInfo<T, ID>(connectionSource, this, dataClass);
    } else {
        tableConfig.extractFieldTypes(connectionSource);
        tableInfo = new TableInfo<T, ID>(databaseType, this, tableConfig);
    }
    statementExecutor = new StatementExecutor<T, ID>(databaseType, tableInfo, this);
    List<BaseDaoImpl<?, ?>> daoConfigList = daoConfigLevelLocal.get();
    daoConfigList.add(this);
    if (daoConfigList.size() > 1) {
        return;
    }
    try {
        for (int i = 0; i < daoConfigList.size(); i++) {
            BaseDaoImpl<?, ?> dao = daoConfigList.get(i);
            DaoManager.registerDao(connectionSource, dao);
            try {
                for (FieldType fieldType : dao.getTableInfo().getFieldTypes()) {
                    fieldType.configDaoInformation(connectionSource, dao.getDataClass());
                }
            } catch (SQLException e) {
                DaoManager.unregisterDao(connectionSource, dao);
                throw e;
            }
            dao.initialized = true;
        }
    } finally {
        daoConfigList.clear();
        daoConfigLevelLocal.remove();
    }
}

void doLineUp(boolean select){
    int caretLine = getCaretLine(), y = 0;
    boolean firstLine = false;
    if (wordWrap) {
        int lineOffset = content.getOffsetAtLine(caretLine);
        int offsetInLine = caretOffset - lineOffset;
        TextLayout layout = renderer.getTextLayout(caretLine);
        int lineIndex = getVisualLineIndex(layout, offsetInLine);
        if (lineIndex == 0) {
            firstLine = caretLine == 0;
            if (!firstLine) {
                caretLine--;
                y = renderer.getLineHeight(caretLine) - 1;
            }
        } else {
            y = layout.getLineBounds(lineIndex - 1).y;
        }
        renderer.disposeTextLayout(layout);
    } else {
        firstLine = caretLine == 0;
        caretLine--;
    }
    if (firstLine) {
        if (select) {
            setCaretOffset(0, SWT.DEFAULT);
        }
    } else {
        int[] alignment = new int[1];
        int offset = getOffsetAtPoint(columnX, y, caretLine, alignment);
        setCaretOffset(offset, alignment[0]);
    }
    int oldColumnX = columnX;
    int oldHScrollOffset = horizontalScrollOffset;
    if (select)
        setMouseWordSelectionAnchor();
    showCaret();
    if (select)
        doSelection(ST.COLUMN_PREVIOUS);
    int hScrollChange = oldHScrollOffset - horizontalScrollOffset;
    columnX = oldColumnX + hScrollChange;
}

boolean intersects(ReadableRectangle r){
    int tw = this.width;
    int th = this.height;
    int rw = r.getWidth();
    int rh = r.getHeight();
    if (rw <= 0 || rh <= 0 || tw <= 0 || th <= 0) {
        return false;
    }
    int tx = this.x;
    int ty = this.y;
    int rx = r.getX();
    int ry = r.getY();
    rw += rx;
    rh += ry;
    tw += tx;
    th += ty;
    return ((rw < rx || rw > tx) && (rh < ry || rh > ty) && (tw < tx || tw > rx) && (th < ty || th > ry));
}

